CREATE TABLE agencies (
            name TEXT PRIMARY KEY,
            short_name TEXT,
            slug TEXT,
            cfr_references TEXT,
            sub_agencies INTEGER,
            word_count INTEGER
        );
CREATE TABLE agency_corrections (
            id SERIAL PRIMARY KEY,
            agency_name TEXT,
            title INTEGER,
            correction_id INTEGER,
            corrective_action TEXT,
            error_corrected TEXT,
            error_occurred TEXT,
            fr_citation TEXT,
            last_modified TEXT,
            FOREIGN KEY (agency_name) REFERENCES agencies (name)
        );
CREATE TABLE cfr_reference_errors (
                id SERIAL PRIMARY KEY,
                agency_name TEXT,
                cfr_reference TEXT,
                error_message TEXT,
                timestamp TEXT
            );
DELETE FROM sqlite_sequence;
